import React from "react";

function ImagePopup(name, link, onClose) {
    console.log(card);
    return (
        <div className={`popup image-popup` + (card ? "image-popup_opened" : "")}>
            <div className="image-popup__container">
                <button type="button" className="popup__close-button popup__close-button_type_image" onClick={onClose}></button>
                <img className="image-popup__pic" alt="" src={link}/>
                <h2 className="image-popup__title">{name}</h2>
            </div>
        </div>
    );
}

export default ImagePopup;
